INSERT INTO `v1_4781c22c66377b86f9ea12f7a98b27a3080f4a369eb71e15dc75506ac0f1f627` VALUES (3, 0, "", 6000, 1, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", "---", 2, "アサヒ", 1);
INSERT INTO `v1_4781c22c66377b86f9ea12f7a98b27a3080f4a369eb71e15dc75506ac0f1f627` VALUES (0, 3, "ホームランを連発すると、連発数に応じてパワーアップする", 16000, 1, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", "アドレナリン", 3, "部員3", 3);
INSERT INTO `v1_4781c22c66377b86f9ea12f7a98b27a3080f4a369eb71e15dc75506ac0f1f627` VALUES (2, 2, "幸運のハプニングを呼び込む", 30000, 1, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", "ラッキー", 4, "{0}", 2);
INSERT INTO `v1_4781c22c66377b86f9ea12f7a98b27a3080f4a369eb71e15dc75506ac0f1f627` VALUES (1, 1, "", 50000, 0, "みんなの知らない極秘情報がのっているおまけページ。決して誰かに見せてはいけない。", "", 5, "選手名鑑 おまけページ", 0);
